input.searchTrigger
            .flatMap { [weak self] query -> AnyPublisher<SearchState, Never> in
                guard let self = self, !query.isEmpty else {
                    return Just(.enter).eraseToAnyPublisher()
                }

                return self.useCase.search(keyword: query)
                    .map { entities in
                        entities.map { entity in
                            FeedSearchUserModel(
                                userId: entity.userId,
                                profileImg: entity.profileImg,
                                nickname: entity.nickname,
                                isFollowing: entity.isFollowing,
                                isFollowed: entity.isFollowed
                            )
                        }
                    }
                    .map { users in
                        users.isEmpty ? .empty : .searchResult(users)
                    }
                    .catch { _ in Just(.empty) }
                    .receive(on: DispatchQueue.main)
                    .eraseToAnyPublisher()
            }
            .eraseToAnyPublisher()

blockedUsersSubject.value.map { user -> BlockedUserModel in
            if user.userId == userId {
                var newUser = user
                newUser = BlockedUserModel(
                    userId: user.userId,
                    nickname: user.nickname,
                    profileImg: user.profileImg,
                    buttonState: isBlocked ? .unblock : .block
                )
                return newUser
            } else {
                return user
            }
        }

wordListSubject.value.map { (date, items) -> (String, [PhraseData]) in
            let updatedItems = items.map { item in
                if item.phraseId == phraseId {
                    var updatedItem = item
                    updatedItem.isMarked = isBookmarked
                    return updatedItem
                }
                return item
            }
            return (date, updatedItems)
        }

